import React from 'react';

const PlanDisplay = ({ plan }) => {
  const days = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'];

  const formatValue = (value, unit) => {
    if (value === 0) return 'Rest';
    return `${value} ${unit}`;
  };

  return (
    <div style={{ marginTop: '30px' }}>
      <h3>Your Personalized Plan</h3>
      <div style={{ 
        background: '#f8f9fa', 
        padding: '15px', 
        borderRadius: '8px', 
        marginBottom: '20px',
        borderLeft: '4px solid #667eea'
      }}>
        <p><strong>Present Weight:</strong> {plan.metadata.present_weight} kg</p>
        <p><strong>Target Weight:</strong> {plan.metadata.expected_weight} kg</p>
        <p><strong>Duration:</strong> {plan.metadata.target_months} months</p>
        <p><strong>Generated:</strong> {new Date(plan.metadata.created_at).toLocaleString()}</p>
      </div>

      <div className="plan-grid">
        {days.map(day => {
          const dayData = plan.plan[day.toLowerCase()];
          if (!dayData) return null;

          return (
            <div key={day} className="plan-card">
              <h3>{day}</h3>

              <div className="plan-section">
                <h4>🏃‍♂️ Workout</h4>
                <p>Treadmill: {formatValue(dayData.treadmill, 'mins')}</p>
                <p>Power Lifting: {formatValue(dayData.power_lifting, 'mins')}</p>
                <p>Squats: {formatValue(dayData.squats, 'mins')}</p>
                <p>Dead Lift: {formatValue(dayData.dead_lift, 'mins')}</p>
                <p>Cycling: {formatValue(dayData.cycling, 'mins')}</p>
                <p>Skipping: {formatValue(dayData.skipping, 'mins')}</p>
              </div>

              <div className="plan-section">
                <h4>🍎 Nutrition</h4>
                <p>Calories: {formatValue(dayData.calories, 'grams')}</p>
                <p>Carbohydrates: {formatValue(dayData.carbohydrates, 'grams')}</p>
                <p>Protein: {formatValue(dayData.protein, 'grams')}</p>
                <p>Fat: {formatValue(dayData.fat, 'grams')}</p>
              </div>
            </div>
          );
        })}
      </div>

      <div style={{ 
        marginTop: '20px', 
        padding: '15px', 
        background: '#e8f4fd', 
        borderRadius: '8px',
        borderLeft: '4px solid #2196f3'
      }}>
        <h4>💡 Plan Tips</h4>
        <ul style={{ marginLeft: '20px', color: '#666' }}>
          <li>Follow the workout schedule consistently for best results</li>
          <li>Maintain the recommended nutrition intake</li>
          <li>Stay hydrated throughout the day</li>
          <li>Get adequate rest and sleep</li>
          <li>Track your progress weekly</li>
        </ul>
      </div>
    </div>
  );
};

export default PlanDisplay;
